uint256 _totalSupply; // STORAGE[0x7]
uint256 _totalDistributed; // STORAGE[0x8]
uint256 _totalRemaining; // STORAGE[0x9]
uint256 _value; // STORAGE[0xa]
uint8 _distributionFinished; // STORAGE[0xb] bytes 0 to 0
address _withdraw; // STORAGE[0x1] bytes 0 to 19

// Events
Approval(address, address, uint256);
Transfer(address, address, uint256);
Burn(address, uint256);
DistrFinished();
Distr(address, uint256);

function fallback() public payable { 
    require(!_distributionFinished);
    require(!(0xff & _blacklist[msg.sender]));
    if (_value > _totalRemaining) {
        _value = _totalRemaining;
    }
    require(_value <= _totalRemaining);
    require(!_distributionFinished);
    assert(_value + _totalDistributed >= _totalDistributed);
    _totalDistributed += _value;
    assert(_value <= _totalRemaining);
    _totalRemaining = _totalRemaining - _value;
    assert(_value + _balanceOf[msg.sender] >= _balanceOf[msg.sender]);
    _balanceOf[msg.sender] += _value;
    emit Distr(msg.sender, _value);
    emit Transfer(0, msg.sender, _value);
    if (_value > 0) {
        _blacklist[msg.sender] = 0x1 | ~0xff & _blacklist[msg.sender];
    }
    if (_totalDistributed >= _totalSupply) {
        _distributionFinished = 1;
    }
    assert(0x186a0);
    v0 = v1 = !(_value / 0x186a0);
    if (_value / 0x186a0) {
        assert(_value / 0x186a0);
        v0 = 0x1869f * (_value / 0x186a0) / (_value / 0x186a0) == 0x1869f;
    }
    assert(v0);
    _value = 0x1869f * (_value / 0x186a0);
}

function name() public nonPayable { 
    v0 = new bytes[]((_name.length & ~0 + (!(_name.length & 0x1) << 8)) >> 1);
    v1 = v2 = v0.data;
    if ((_name.length & ~0 + (!(_name.length & 0x1) << 8)) >> 1) {
        if (31 < (_name.length & ~0 + (!(_name.length & 0x1) << 8)) >> 1) {
            do {
                MEM[v1] = STORAGE[v3];
                v3 += 1;
                v1 += 32;
            } while (v2 + ((_name.length & ~0 + (!(_name.length & 0x1) << 8)) >> 1) <= v1);
        } else {
            MEM[v2] = _name.length >> 8 << 8;
        }
    }
    v4 = new array[](v0.length);
    v5 = v6 = 0;
    while (v5 < v0.length) {
        MEM[v5 + v4.data] = MEM[v5 + v0.data];
        v5 += 32;
    }
    v7 = v8 = v0.length + v4.data;
    if (0x1f & v0.length) {
        MEM[v8 - (0x1f & v0.length)] = ~(256 ** (32 - (0x1f & v0.length)) - 1) & MEM[v8 - (0x1f & v0.length)];
    }
    return v4;
}

function approve(address varg0, uint256 varg1) public nonPayable { 
    v0 = v1 = varg1;
    if (varg1) {
        v0 = _allowance[varg0];
    }
    if (!v0) {
        _allowance[varg0] = varg1;
        emit Approval(msg.sender, varg0, varg1);
        v2 = v3 = 1;
    } else {
        v2 = v4 = 0;
    }
    return v2;
}

function totalSupply() public nonPayable { 
    return _totalSupply;
}

function transferFrom(address varg0, address varg1, uint256 varg2) public nonPayable { 
    assert(msg.data.length >= 100);
    require(varg1);
    require(varg2 <= _balanceOf[varg0]);
    require(varg2 <= _allowance[msg.sender]);
    assert(varg2 <= _balanceOf[varg0]);
    _balanceOf[varg0] = _balanceOf[varg0] - varg2;
    assert(varg2 <= _allowance[msg.sender]);
    _allowance[msg.sender] = _allowance[msg.sender] - varg2;
    assert(varg2 + _allowance[varg1] >= _allowance[varg1]);
    _balanceOf[varg1] = varg2 + _allowance[varg1];
    emit Transfer(varg0, varg1, varg2);
    return 1;
}

function decimals() public nonPayable { 
    return 18;
}

function withdraw() public nonPayable { 
    require(msg.sender == _withdraw);
    v0 = _withdraw.call().value(this.balance).gas(2300 * !this.balance);
    require(v0); // checks call status, propagates error data on error
}

function value() public nonPayable { 
    return _value;
}

function burn(uint256 varg0) public nonPayable { 
    require(msg.sender == _withdraw);
    require(varg0 <= _balanceOf[msg.sender]);
    assert(varg0 <= _balanceOf[msg.sender]);
    _balanceOf[msg.sender] = _balanceOf[msg.sender] - varg0;
    assert(varg0 <= _totalSupply);
    _totalSupply = _totalSupply - varg0;
    assert(varg0 <= _totalDistributed);
    _totalDistributed = _totalDistributed - varg0;
    emit Burn(msg.sender, varg0);
}

function balanceOf(address varg0) public nonPayable { 
    return _balanceOf[varg0];
}

function symbol() public nonPayable { 
    v0 = new bytes[]((_symbol.length & ~0 + (!(_symbol.length & 0x1) << 8)) >> 1);
    v1 = v2 = v0.data;
    if ((_symbol.length & ~0 + (!(_symbol.length & 0x1) << 8)) >> 1) {
        if (31 < (_symbol.length & ~0 + (!(_symbol.length & 0x1) << 8)) >> 1) {
            do {
                MEM[v1] = STORAGE[v3];
                v3 += 1;
                v1 += 32;
            } while (v2 + ((_symbol.length & ~0 + (!(_symbol.length & 0x1) << 8)) >> 1) <= v1);
        } else {
            MEM[v2] = _symbol.length >> 8 << 8;
        }
    }
    v4 = new array[](v0.length);
    v5 = v6 = 0;
    while (v5 < v0.length) {
        MEM[v5 + v4.data] = MEM[v5 + v0.data];
        v5 += 32;
    }
    v7 = v8 = v0.length + v4.data;
    if (0x1f & v0.length) {
        MEM[v8 - (0x1f & v0.length)] = ~(256 ** (32 - (0x1f & v0.length)) - 1) & MEM[v8 - (0x1f & v0.length)];
    }
    return v4;
}

function finishDistribution() public nonPayable { 
    require(msg.sender == _withdraw);
    require(!_distributionFinished);
    _distributionFinished = 1;
    emit DistrFinished();
    return 1;
}

function transfer(address varg0, uint256 varg1) public nonPayable { 
    assert(msg.data.length >= 68);
    require(varg0);
    require(varg1 <= _balanceOf[msg.sender]);
    assert(varg1 <= _balanceOf[msg.sender]);
    _balanceOf[msg.sender] = _balanceOf[msg.sender] - varg1;
    assert(varg1 + _balanceOf[varg0] >= _balanceOf[varg0]);
    _balanceOf[varg0] += varg1;
    emit Transfer(msg.sender, varg0, varg1);
    return 1;
}

function distributionFinished() public nonPayable { 
    return _distributionFinished;
}

function getTokenBalance(address varg0, address varg1) public nonPayable { 
    require(varg0.code.size);
    v0, v1 = varg0.balanceOf(varg1).gas(msg.gas);
    require(v0); // checks call status, propagates error data on error
    require(RETURNDATASIZE() >= 32);
    return v1;
}

function totalRemaining() public nonPayable { 
    return _totalRemaining;
}

function allowance(address varg0, address varg1) public nonPayable { 
    return _allowance[varg1];
}

function withdrawForeignTokens(address varg0) public nonPayable { 
    require(msg.sender == _withdraw);
    require(varg0.code.size);
    v0, v1 = varg0.balanceOf(this).gas(msg.gas);
    require(v0); // checks call status, propagates error data on error
    require(RETURNDATASIZE() >= 32);
    require(varg0.code.size);
    v2, v3 = varg0.transfer(_withdraw, v1).gas(msg.gas);
    require(v2); // checks call status, propagates error data on error
    require(RETURNDATASIZE() >= 32);
    return v3;
}

function totalDistributed() public nonPayable { 
    return _totalDistributed;
}

function transferOwnership(address varg0) public nonPayable { 
    require(msg.sender == _withdraw);
    if (varg0) {
        _withdraw = varg0;
    }
}

function blacklist(address varg0) public nonPayable { 
    return 0xff & _blacklist[varg0];
}

